/**
 * @license Copyright (c) 2013, CKSource - Frederico Knabben
 * For licensing, see LICENSE
 */

"use strict";

/* global define: false */

(function (factory) {

    if ("function" === typeof define) {
        define([
            "data-container/Repository"
        ], factory);
    } else {
        module.exports = factory.apply(null, [
            require("data-container").Repository
        ]);
    }

}(function (Repository) {

    var EventDispatcherRepository; // constructor, function

    /**
     * @auguments data-container/Repository
     * @constructor
     */
    EventDispatcherRepository = function () {
        Repository.call(this);
    };
    EventDispatcherRepository.prototype = Object.create(Repository.prototype);

    return EventDispatcherRepository;

}));
